import React from 'react'
import { useSelector } from 'react-redux';
import Productlist from '../components/Productlist';
const Home = () => {
    const products = useSelector(state => state.product.products)
    return (
        <div>
            <Productlist products = {products}/>
        </div>
    );
}

export default Home
